import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import * as serviceWorker from './serviceWorker';
import 'bootstrap/dist/css/bootstrap.css';
import 'popper/popper.js';
import App from './components/App';
import history from './history';
import Main from './components/Main';
import Login from './components/Login';
import Signup from './components/Signup';
import { Route, Switch, Router } from 'react-router-dom';

//ReactDOM.render(<App history={history}></App>, document.getElementById('root'));

/*const mainPage = <Router history={history}>
                    <Switch>
                        <Route
                            exact path="/" 
                            render={(props) => <Main {...props}></Main>}>
                        </Route>
                        <Route
                            exact path="/login" 
                            render={(props) => <Login {...props}></Login>}>
                        </Route>
                        <Route
                            exact path="/signup" 
                            render={(props) => <Signup {...props}></Signup>}>
                        </Route>
                    </Switch>
                 </Router>*/

ReactDOM.render(<App history={history}></App>, document.getElementById('root'));

// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: https://bit.ly/CRA-PWA
serviceWorker.unregister();
